> Entertainment PSY feuding with artist tenants of his Seoul building FILE - In this photo Dec. 20, 2014 file photo, South Korean singer PSY performs during his concert in Seoul, South Korea. PSY is fighting an ugly legal battle with artist tenants who are reluctant to leave a building he owns in Seoul. Choi Jee Ahn of Takeout Drawing said Thursday, Oct. 22, 2015 that about 10 lawsuits have been exchanged between a gallery the artists belong to and their YouTube star landlord. (AP Photo/Lee Jin-man, File) 
